void update_flags(char *s)
{
	if(strcmp(s,"email") == 0)
		flags |= 1 << BIT_EMAIL;
	else if(strcmp(s,"word") == 0){
		flags |= 1 << BIT_WORD;
		flags |= 1 << BIT_GREEK;
	}else if(strcmp(s,"punct") == 0)
		flags |= 1 << BIT_PUNCT;
	else if(strcmp(s,"num") == 0)
		flags |= 1 << BIT_NUM;
	else if(strcmp(s,"date") == 0)
		flags |= 1 << BIT_DATE;
	else if(strcmp(s,"sym") == 0)
		flags |= 1 << BIT_SYM;
	else if(strcmp(s,"uri") == 0)
		flags |= 1 << BIT_URI;
	else if(strcmp(s,"greek") == 0)
		flags |= 1 << BIT_GREEK;
	else if(strcmp(s,"other") == 0)
		flags |= 1 << BIT_OTHER;
	else
		error("ERROR: Unknown token type %s",s);
}

void parse_flags(char *s)
{
	char p[16],c;
	int idx = 0;
	flags = 0;
	while((c = *s++) != 0){
		if(c == ','){
			p[idx] = 0;
			update_flags(p);
			idx = 0;
			continue;
		}
		p[idx++] = c;
		if(idx == 32)
			error("ERROR: Uknown token type");
	}
	p[idx] = 0;
	update_flags(p);
}

void help(char **argv)
{
	printf("%s: [OPTIONS] [INPUT_FILES]\n"
	"\t\t-a type1,type2,... accept only token types\n"
	"\t\t-r type1,type2,... reject token types\n"
	"\t\t-w                 count words\n"
	"valid token types: word,email,punct\n",argv[0]);
}

int main(int argc, char **argv)
{
	/* tool options input_files
	options: -a accept only
	
		  -r reject
		  -w count words
	email,date,words,punct,uri,greek
	*/
	long count;
	int idx;
	input_t in;
	char parsed_file = 0;
	flags = 0xffffffff;

	for(idx = 1;idx < argc;idx++){
		if(argv[idx][0] == '-' ){
			if(argv[idx][2] != 0)
				error("ERROR: Unknown option %s\n",argv[idx]);
			if(argv[idx][1] == 'a' || argv[idx][1] == 'r'){
				idx++;
				if(flags != 0xffffffff && flags != 0)
					error("ERROR: Options -r -a are mutual exclusive\n");
				if(idx < argc)
					parse_flags(argv[idx]);
				else
					error("ERROR: Option -a expects token types, see -h for help\n");
				if(argv[idx-1][1] == 'r')
					flags = ~flags;
			}
			else if(argv[idx][1] == 'w')
				count_words = 1;
			else if(argv[idx][1] == 'h'){
				help(argv);
				return 0;
			}
			else
				error("ERROR: Unknown option %s\n",argv[idx]);
		}
		else{
			parsed_file = 1;
			init_input(&in, argv[idx]);
			lex(&in, &count);
			free_input(&in);
		}
	}
	if(!parsed_file){
			init_input(&in, 0);
			lex(&in, &count);
			free_input(&in);
	}
	
	return 0;
}
